import React, { useEffect, useState } from 'react';


const App = () => {
  const fetchPets = async () => {
    const response = await axios.get('/api/adoptapet');
    return response.data;
  }

  const PetList = () => {
    const [pets, setPets] = useState([]);
  
    useEffect(() => {
      const fetchPets = async () => {
        const pets = await fetchPets();
        setPets(pets);
      };
      fetchPets();
    }, []);
  
    return (
      <div>
        {pets.map(pet => (
          <Pet key={pet.id} {...pet} />
        ))}
      </div>
    );
  }

};

export default App;
